------------------
-- Create database
------------------

if not exists(select * from sys.databases where name = 'top40')
    create database top40
go

use top40
go

drop table if exists Listing
drop table if exists Track
go

create table Track (
     TrackId             int             not null
    ,TrackArtist         varchar(255)    not null
    ,TrackTitle          varchar(255)    not null
    ,constraint PK_Track primary key (TrackId)
    ,constraint AK_Track unique (TrackArtist,TrackTitle)
)

create table Listing (
     ListingYear         int             not null 
    ,ListingWeek         tinyint         not null
    ,ListingPosition     tinyint         not null
    ,ListingTrackId      int             not null
    ,constraint PK_Listing primary key (ListingYear,ListingWeek,ListingPosition)
    ,constraint FK_TrackListing foreign key (ListingTrackId) references Track (TrackId)
    ,constraint AK_Listing unique (ListingYear,ListingWeek,ListingTrackId)
)
go

